import './Dialogs.css';
import {NavLink} from "react-router-dom";

const Dialogs = () => {
	return (
		<div className='dialogs'>
			<ul className="dialogs__list">
				<li><NavLink to="">Andrew</NavLink></li>
				<li><NavLink to="">Dmitry</NavLink></li>
				<li><NavLink to="">Sasha</NavLink></li>
				<li><NavLink to="">Sveta</NavLink></li>
				<li><NavLink to="">Valera</NavLink></li>
				<li><NavLink to="">Victor</NavLink></li>
			</ul>
			<div className="dialogs__current">

			</div>
		</div>
	)
}

export default Dialogs;
